import React from 'react'
import './App.css'
import Subsection from './Subsection.js'

class Section extends React.Component {
	constructor(){
		super()
	this.Subsection = this.Subsection.bind(this);
	}

	render() {
		return (
			<div>
				<h3>Sections</h3>

				{
					this.state.data.sectionmap((item) =>
				<div>
					<h3>{item.number}</h3>	
				<ul>
					<li>Instructor: {item.instructor}</li>
					<li>Location: {item.location}</li>
					<li>Metting Times
						<ul>
						{
							item.details.map((subitem, i) => 
						<li>{i}:{subitem}</li>
						)
						}
						</ul>
					</li>
				</ul>) 
				<div>
					{this.Subsection}
				</div>
				</div>
				)
				}

			</div>
		)
	}
}

export default Section;
